import React, { useState } from "react";
import { Bar } from "react-chartjs-2";
import styles from "./MyClass.module.css";

const MyClass = () => {
  const [selectedClass, setSelectedClass] = useState("Class A");
  const [activeTab, setActiveTab] = useState("quizzes");

  const classes = ["Class A", "Class B", "Class C"];
  const quizzes = [
    { id: 1, name: "Quiz 1", date: "2025-05-01" },
    { id: 2, name: "Quiz 2", date: "2025-05-03" },
  ];
  const students = [
    { id: 1, name: "Student 1" },
    { id: 2, name: "Student 2" },
  ];

  const chartData = {
    labels: ["Quiz 1", "Quiz 2", "Quiz 3", "Quiz 4", "Quiz 5"],
    datasets: [
      {
        label: "Average Accuracy (%)",
        data: [85, 90, 78, 88, 92],
        backgroundColor: "#4caf50",
      },
    ],
  };

  return (
    <div className={styles.myClassPage}>
      <div className={styles.header}>
        <h1>My Class</h1>
      </div>
      {/* Class Tabs */}
      <div className={styles.classTabs}>
        {classes.map((className) => (
          <button
            key={className}
            className={`${styles.tab} ${selectedClass === className ? styles.activeTab : ""}`}
            onClick={() => setSelectedClass(className)}
          >
            {className}
          </button>
        ))}
      </div>

      <div className={styles.headerButtons}>
          <button className={styles.button}>Create Class</button>
          <button className={styles.button}>Archived Classes</button>
          <button className={styles.button}>Manage Class</button>
      </div>

      {/* Class Info */}
      <div className={styles.classInfo}>
        <div className={styles.stats}>
          <h2>Class Statistics</h2>
          <p>Total Students: 25</p>
          <p>Total Quizzes: 10</p>
          <div className={styles.accuracyStats}>
            <div>
              <h3>Average Accuracy</h3>
              <p>85%</p>
            </div>
            <div>
              <h3>Highest Accuracy</h3>
              <p>95%</p>
            </div>
            <div>
              <h3>Lowest Accuracy</h3>
              <p>70%</p>
            </div>
          </div>
        </div>
        <div className={styles.chart}>
          <h2>Recent Quiz Accuracy</h2>
          <Bar data={chartData} />
        </div>
      </div>

      {/* Bottom Tabs */}
      <div className={styles.bottomTabs}>
        <button
          className={`${styles.tab} ${activeTab === "quizzes" ? styles.activeTab : ""}`}
          onClick={() => setActiveTab("quizzes")}
        >
          Quizzes
        </button>
        <button
          className={`${styles.tab} ${activeTab === "students" ? styles.activeTab : ""}`}
          onClick={() => setActiveTab("students")}
        >
          Students
        </button>
      </div>

      {/* Tab Content */}
      <div className={styles.tabContent}>
        {activeTab === "quizzes" ? (
          <div className={styles.list}>
            <h2>Quizzes</h2>
            <ul>
              {quizzes.map((quiz) => (
                <li key={quiz.id}>
                  {quiz.name} - {quiz.date}
                </li>
              ))}
            </ul>
          </div>
        ) : (
          <div className={styles.list}>
            <h2>Students</h2>
            <ul>
              {students.map((student) => (
                <li key={student.id}>{student.name}</li>
              ))}
            </ul>
          </div>
        )}
      </div>
    </div>
  );
};

export default MyClass;
